import React from 'react';
import { Grid, Text, Input, Button } from "../elements";

import { useDispatch } from 'react-redux';
import { actionCreators as userActions } from '../redux/modules/user';

const Signup = (props) => {
    const dispatch = useDispatch();

    const [id, setId] = React.useState('');
    const [pwd, setPwd] = React.useState('');
    const [pwd_check, setPwd_check] = React.useState('');
    const [user_name, setUserName] = React.useState('');

    const signup = () => {

        dispatch(userActions.signupFB());
    }
    return (
        <React.Fragment>
            <Grid padding="16px">
                <Text size="32px" bold>회원가입</Text>
                <Grid padding="16px 0px">
                    <Input
                        label="아이디"
                        placeholder="아이디를 입력해주세요."
                        _onChange={(e) => { setId(e.target.value); }}></Input>
                </Grid>
                <Grid padding="16px 0px"> 
                    <Input
                        label="닉네임"
                        placeholder="닉네임을 입력해주세요."
                        _onChange={(e) => { setUserName(e.target.value); }}></Input>
                </Grid>
                <Grid padding="16px 0px">
                    <Input
                        label="비밀번호"
                        placeholder="비밀번호를 입력해주세요."
                        _onChange={(e) => { setPwd(e.target.value); }}></Input>
                </Grid>
                <Grid padding="16px 0px">
                    <Input
                        label="비밀번호 확인"
                        placeholder="비밀번호를 다시 입력해주세요."
                        _onChange={(e) => { setPwd(e.target.value); }}></Input>
                </Grid>
                <Button text="회원가입" _onClick={signup}></Button>
            </Grid>
        </React.Fragment>
    )
}

Signup.degaultProps = {}

export default Signup;
